import React from "react";
import InfiniteScroll from "react-infinite-scroll-component";
import {Gallery, Item} from "react-photoswipe-gallery";
import 'photoswipe/dist/photoswipe.css'
import 'photoswipe/dist/default-skin/default-skin.css'
import {useTypedSelector} from "../../types/redux.types";

const List = (): JSX.Element => {
    const list = useTypedSelector((state) => state.photos.list);
    const allCountPhotos = useTypedSelector((state) => state.photos.allCount);

    return (
            <Gallery>
                <div className="grid-gallery">
                    <InfiniteScroll
                        dataLength={list.length}
                        next={() => {
                        }}
                        hasMore={allCountPhotos > list.length}
                        loader={<div/>}
                    >
                        {list.map(({urls, user, id, width, height, description, liked_by_user}) =>
                            <Item
                                key={id}
                                original={urls.full}
                                thumbnail={urls.small}
                                // width={width}
                                // height={height}
                            >
                                {({ref, open}) => (
                                    <div className="destination" ref={ref as React.MutableRefObject<HTMLImageElement>} onClick={open} style={{backgroundImage: `url(${urls.small})`}}>
                                        <div className="overlay">
                                            <div className="user">
                                                <img src={user.profile_image.small} alt=""/>
                                            </div>
                                            <div className="actions">
                                                <div
                                                    className={`like ${liked_by_user ? 'active': ''}`}
                                                    onClick={()=>{}}
                                                >
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                    // <img
                                    //     style={{cursor: 'pointer'}}
                                    //     src={urls.small} alt={description}
                                    //     ref={ref as React.MutableRefObject<HTMLImageElement>}
                                    //     onClick={open}
                                    // />
                                    // <div className="destination" ref={ref as React.MutableRefObject<HTMLImageElement>} onClick={open}>
                                    //     <div className="overlay">
                                    //         <div className="user">
                                    //             <img src={urls.small} alt={description}/>
                                    //         </div>
                                    //     </div>
                                    // </div>
                                )}
                            </Item>
                        )}
                    </InfiniteScroll>
                </div>
            </Gallery>
    )
}

export default List;
